import { PathService } from './path.service'
export default {
  serviceInject() {
    return {
      pathService: PathService
    }
  },
  rxState() {
    const { pathList$, loading$ } = this.pathService
    return {
      pathList: pathList$,
      loading: loading$
    }
  },
  data() {
    return {
      show: false
    }
  },
  created() {
    this.pathService.getPathList().subscribe()
  }
}
